import React from "react";

function Newsletter(props) {
  const Newsletter = () => {
    return (
      <div>
        <div className="image">
          <img src={props.image} alt="molotov cover image" />
        </div>
        <div className="title">
          <h3>{props.title}</h3>
          <span>{props.number}</span>
        </div>
        <div className="link">
          <a href={props.link}>Read</a>
        </div>
      </div>
    );
  };
  return (
    <div>
      <Newsletter
        image="/images/v1n1.jpg"
        title="Molotov"
        number="Vol-1 No-1"
        link="/molotov/v1n1"
      />
    </div>
  );
}

export default Newsletter;
